import React from 'react';
import pc from './MyPosts.module.css'
import Post from "./Post/Post";

const MyPosts = () => {
    let PostData = [
        {id: 1, Post: 'post1', likesCount :12},
        {id: 2, Post: 'post2', likesCount :2},
        {id: 3, Post: 'post3', likesCount :11},
        {id: 4, Post: 'post4', likesCount :5},
        {id: 5, Post: 'post5', likesCount :121}
    ]

    return (

        <div className={pc.pp}>
            <h3>My posts</h3>
            <div>
                <div>
                    <textarea> </textarea>
                </div>
                <div>
                    <button> add post</button>
                </div>
            </div>
            <div className={pc.marginPost}>
                <Post message={PostData[0].Post} likecount={PostData[0].likesCount}/>
                <Post message={PostData[1].Post} likecount={PostData[1].likesCount}/>
                <Post message={PostData[2].Post} likecount={PostData[2].likesCount}/>
                <Post message={PostData[3].Post} likecount={PostData[3].likesCount}/>
                <Post message={PostData[4].Post} likecount={PostData[4].likesCount}/>

            </div>
        </div>
    );
}
export default MyPosts;
